import '../App.css';

const [myData, setData] = useState('q')

function Stations() {
  useEffect(() => {
    fetch('/').then(response => response.json().then(data=>{
      setData(data);
    }
  ));
  }, []);


  return(
    <div>
      {myData}
    </div>
  );

}


export default Stations;
